    false,nt"url": null,nt"notes": "Slope is derived from gridded (10 m cell
    size) multibeam bathymetry, collected aboard NOAA Ship Hiialaka'i and R/V AHI. Cell
    values reflect the maximum rate of change (in degrees) in elevation between neighboring
    cells derived with the ArcGIS Spatial Analyst extension. This data set is for the
    shelf environment of Pagan Island. CNMI and Guam slope maps are all symbolized with
    the same classified color ramp (with the exception of a unique maximum value) in
    order to provide a standard for qualitative comparisons between islands.",nt"owner_org":
